import React from 'react';
import { Paper, Stack } from '@mui/material';
import CustomTextField from '../input/CustomTextField';
//import { Formik } from 'formik';


const LoginForm  = () =>{
    return(
        <Paper elevation={2}>
            <Stack
             spacing = {4}
             sx={{padding : 4}}
             >
                <CustomTextField 
                 label={'email'}
                 />
                 <CustomTextField 
                 label={'password'}
                 />
                 <CustomTextField 
                 label={'email'}
                 />
            </Stack>
        </Paper>
    );

}

export default LoginForm;
